        public PrinterDriver(BluetoothSocket btsocket) throws IOException {
        this.socket = btsocket;
        if (this.socket != null) {
            this.btoutputstream = this.socket.getOutputStream();
        
            // Set cyrillic character
            btoutputstream.write(new byte[] { 27, 116, 17}); // cyrillic character
        }
        }
        
        public void setAlignLeft() throws IOException {
        this.btoutputstream.write(new byte[] { 27, 97, 0});
        }
        
        public void setAlignCenter() throws IOException {
        this.btoutputstream.write(new byte[] { 27, 97, 1});
        }
        
        public void setAlignRight() throws IOException {
        this.btoutputstream.write(new byte[] { 27, 97, 2});
        }
        
        public void setFontA() throws IOException {
        fontStyle &= 254;
        this.btoutputstream.write(new byte[] { 27, 33, fontStyle});
        }
        
        public void setDoubleFont(boolean flag) throws IOException {
                fontStyle |= 1;
                if (flag) {
                        fontStyle |= 48;
                } else {
                        fontStyle &= 207;
                }
                this.btoutputstream.write(new byte[] { 27, 33, fontStyle});
        }

        public void setFontB() throws IOException {
                fontStyle |= 1;
                this.btoutputstream.write(new byte[] { 27, 33, fontStyle});
        }
        
        public void printNameQueue(String str) throws IOException {
                this.setFontA();
                this.btoutputstream.write(this.getBytesCP688(str));
                this.printNewLine();
        }

        public void printDescQueue(String str) throws IOException {
                this.setFontB();
                this.btoutputstream.write(this.getBytesCP688(str));
                this.printNewLine();
        }

        public void printNumber(Integer num) throws IOException {
                this.printNameQueue("Ваш номер:");
                this.setDoubleFont(true);
                this.btoutputstream.write(this.getBytesCP688(String.valueOf(num) + "\n"));
                this.setDoubleFont(false);
        }

        public void printNewLine() throws IOException {
                this.btoutputstream.write(new byte[]{10});
        }

        public void printDoubleLine() throws IOException {
                this.setFontB();
                for (int i = 0; i < 42; i++) this.btoutputstream.write(new byte[]{ (byte) 0xCD});
                this.printNewLine();
        }
        
